import React, { useState } from 'react';

const PlayerList = () => {
    const [formData, setFormData] = useState({
        teamWhite: {
            goalie: '',
            player1: '',
            player2: '',
            player3: '',
            player4: '',
            player5: '',
            player6: '',
            player7: '',
        },
        teamBlack: {
            goalie: '',
            player1: '',
            player2: '',
            player3: '',
            player4: '',
            player5: '',
        },
    });

    const handlePlayerNameChange = (team, player, newName) => {
        setFormData((prevData) => {
            const updatedData = { ...prevData };
            updatedData[team][player] = newName;
            return updatedData;
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Do something with the form data, e.g., send it to a server or display it.
        console.log('Form Data:', formData);
    };

    console.log(formData)
    return (
        <div>
            <h2>Team Form</h2>
            <form onSubmit={handleSubmit}>
                <div className="team">
                    <h3>Team White</h3>
                    <input
                        type="text"
                        value={formData.teamWhite.goalie}
                        onChange={(e) => handlePlayerNameChange('teamWhite', 'goalie', e.target.value)}
                        placeholder="Goalie"
                    />
                    <input
                        type="text"
                        value={formData.teamWhite.player1}
                        onChange={(e) => handlePlayerNameChange('teamWhite', 'player1', e.target.value)}
                        placeholder="Player 1"
                    />
                    <input
                        type="text"
                        value={formData.teamWhite.player2}
                        onChange={(e) => handlePlayerNameChange('teamWhite', 'player2', e.target.value)}
                        placeholder="Player 2"
                    />
                    <input
                        type="text"
                        value={formData.teamWhite.player3}
                        onChange={(e) => handlePlayerNameChange('teamWhite', 'player3', e.target.value)}
                        placeholder="Player 3"
                    />
                    <input
                        type="text"
                        value={formData.teamWhite.player4}
                        onChange={(e) => handlePlayerNameChange('teamWhite', 'player4', e.target.value)}
                        placeholder="Player 4"
                    />
                    <input
                        type="text"
                        value={formData.teamWhite.player5}
                        onChange={(e) => handlePlayerNameChange('teamWhite', 'player5', e.target.value)}
                        placeholder="Player 5"
                    />
                </div>
                <div className="team">
                    <h3>Team Black</h3>
                    <input
                        type="text"
                        value={formData.teamBlack.goalie}
                        onChange={(e) => handlePlayerNameChange('teamBlack', 'goalie', e.target.value)}
                        placeholder="Goalie"
                    />
                    <input
                        type="text"
                        value={formData.teamBlack.player1}
                        onChange={(e) => handlePlayerNameChange('teamBlack', 'player1', e.target.value)}
                        placeholder="Player 1"
                    />
                    <input
                        type="text"
                        value={formData.teamBlack.player2}
                        onChange={(e) => handlePlayerNameChange('teamBlack', 'player2', e.target.value)}
                        placeholder="Player 2"
                    />
                    <input
                        type="text"
                        value={formData.teamBlack.player3}
                        onChange={(e) => handlePlayerNameChange('teamBlack', 'player3', e.target.value)}
                        placeholder="Player 3"
                    />
                    <input
                        type="text"
                        value={formData.teamBlack.player4}
                        onChange={(e) => handlePlayerNameChange('teamBlack', 'player4', e.target.value)}
                        placeholder="Player 4"
                    />
                    <input
                        type="text"
                        value={formData.teamBlack.player5}
                        onChange={(e) => handlePlayerNameChange('teamBlack', 'player5', e.target.value)}
                        placeholder="Player 5"
                    />
                </div>
                <button type="submit">Submit</button>
            </form>
        </div>
    );
};

export default PlayerList;
